INSERT INTO [dbo].[Employers]
           ([EmployerName]
           ,[AddressLine1]
           ,[AddressLine2]
           ,[City]
           ,[State]
           ,[Country]
           ,[ZipCode]
           ,VendorImportID
           )

select distinct
	[Employer Name]
	,[Employer Address AddrLine 1]
	,[Employer Address AddrLine 2]
	,[Employer Address AddrCity]
	,[Employer Address Addr State]
	,[Employer Address Addr Country]
	,[Employer Address Addr ZipCode]
	,1 as VedorImportID
FROM dbo.zz_import_20100507_patient
where isnull([Employer Name], '') <> ''


alter table zz_import_20100507_patient add employerID int

update z
set employerId=e.employerID
from zz_import_20100507_patient z
	inner join dbo.Employers e
		on 	[Employer Name]=e.[EmployerName]
			and [Employer Address AddrLine 1]=e.[AddressLine1]
			and [Employer Address AddrLine 2]=e.[AddressLine2]
			and [Employer Address AddrCity]=e.City
			and [Employer Address Addr State]=e.State
			and [Employer Address Addr Country]=e.[Country]
			and [Employer Address Addr ZipCode]=e.[ZipCode]


update zz_import_20100507_patient
set [Home Phone]=replace([Home Phone], '(', ''),
	[Work Phone]=replace([Work Phone], '(', '')
	
	
update zz_import_20100507_patient
set [Home Phone]=replace([Home Phone], ')', ''),
	[Work Phone]=replace([Work Phone], ')', '')
	
	
update zz_import_20100507_patient
set [Home Phone]=replace([Home Phone], '-', ''),
	[Work Phone]=replace([Work Phone], '-', '')
	
update zz_import_20100507_patient
set [Home Phone]=replace([Home Phone], ' ', ''),
	[Work Phone]=replace([Work Phone], ' ', '')

update zz_import_20100507_patient
set [Marital Status] = case when [Marital Status] = '' then null else [Marital Status] end





