INSERT INTO [dbo].[Patient](
	MedicalRecordNumber,
	prefix,
	[PracticeID],
	[FirstName],
	MiddleName,
	[LastName],
	Suffix,
	[Gender],
	MaritalStatus,
	
	[AddressLine1],
	[AddressLine2],
	[City],
	[State],
	[ZipCode],
	Country,
	
	[HomePhone],
	HomePhoneExt,
	WorkPhone,
	WorkPhoneExt,
	
	EmailAddress,
	[DOB],
	SSN,
	[VendorID],
	VendorImportID,
	
	CollectionCategoryID,
	DefaultServiceLocationID,
	PrimaryProviderID,
	
	EmploymentStatus,
	EmployerID,
	
	ResponsibleDifferentThanPatient,
	ResponsiblePrefix,
	ResponsibleFirstName,
	ResponsibleMiddleName,
	ResponsibleLastName,
	ResponsibleSuffix,
	ResponsibleRelationshipToPatient,
	ResponsibleAddressLine1,
	ResponsibleAddressLine2,
	ResponsibleCity,
	ResponsibleState,
	ResponsibleCountry,
	ResponsibleZipCode
)
SELECT 
	[Unique Patient ID]
  ,isnull([Prefix], '')
  ,1 as practiceID
  ,isnull([First Name], '')
  ,isnull([Middle Name], '')
  ,isnull([Last Name], '')
  ,isnull([Suffix], '')
  ,[Gender]
  ,[Marital Status]
  
  ,[Addr Line 1]
  ,[Addr Line 2]
  ,[City]
  ,[State]
  ,[ZipCode]
  ,[Country]
  
  ,[Home Phone]
  ,[Home Ext]
  ,[Work Phone]
  ,[Work Ext]
  
  ,[Email Address]
  ,[Date of Birth]
  ,replace([SSN], '-', '')
  ,min(rowID) as vendorID
  ,1 as VendorImportID
  
  ,1 as CollectionCategoryID
  ,null as DefaultServiceLocationID
  ,null as PrimaryProviderID
  
  ,[Employment Status]
  , EmployerID
  
  ,case when [Guarantor Name First Name] is not null then 1 else null end as ResponsibleDifferentThanPatient
  ,[Guarantor Name Prefix]
  ,[Guarantor Name First Name]
  ,[Guarantor Name Middle Name]
  ,[Guarantor Name Last Name]
  ,[Guarantor Name Suffix]
  ,case when [Guarantor Relationship] is not null then 'O' else null end as [Guarantor Relationship]
  ,[Guarantor Name Addr Line 1]
  ,[Guarantor Name Addr Line 2]
  ,[Guarantor Name Addr City]
  ,[Guarantor Name Addr State]
  ,[Guarantor Name Addr Country]
  ,[Guarantor Name Addr Zipcode]
FROM dbo.zz_import_20100507_patient
	group by 
	[Unique Patient ID]
  ,isnull([Prefix], '')
  ,isnull([First Name], '')
  ,isnull([Middle Name], '')
  ,isnull([Last Name], '')
  ,isnull([Suffix], '')
  ,[Gender]
  ,[Marital Status]
  
  ,[Addr Line 1]
  ,[Addr Line 2]
  ,[City]
  ,[State]
  ,[ZipCode]
  ,[Country]
  
  ,[Home Phone]
  ,[Home Ext]
  ,[Work Phone]
  ,[Work Ext]
  
  ,[Email Address]
  ,[Date of Birth]
  ,replace([SSN], '-', '')
  ,[Employment Status]
  , EmployerID
  
  ,case when [Guarantor Name First Name] is not null then 1 else null end
  ,[Guarantor Name Prefix]
  ,[Guarantor Name First Name]
  ,[Guarantor Name Middle Name]
  ,[Guarantor Name Last Name]
  ,[Guarantor Name Suffix]
  ,case when [Guarantor Relationship] is not null then 'O' else null end
  ,[Guarantor Name Addr Line 1]
  ,[Guarantor Name Addr Line 2]
  ,[Guarantor Name Addr City]
  ,[Guarantor Name Addr State]
  ,[Guarantor Name Addr Country]
  ,[Guarantor Name Addr Zipcode]

