alter table zz_import_20100507_insurance add insuranceCompanyID int

update insuranceCompany
set VendorImportID=1
where cast(notes as varchar(max)) = 'Imported by Kareo on May 10, 2010'

update z
set insuranceCompanyID=ic.insuranceCompanyID
from dbo.zz_import_20100507_insurance z
	inner join insuranceCompany ic
		on InsuranceCompanyName=isnull(z.Insurance, '')
		and isnull(z.Addr1, '')=AddressLine1
		and isnull(z.add2, '')=AddressLine2
		and ic.City=isnull(z.city, '')
		and ic.State=isnull(z.state, '')
		and ic.ZipCode=isnull(z.Zip, '')
where VendorImportID=1



	select distinct Insurance,
	'exec [dbo].[InsurancePlanDataProvider_CreateInsuranceCompany]
		@name = ''' + Insurance + ''',
	
