alter table zz_import_20100507_insurance add rowid int identity(1,1)

update insuranceCompanyPlan
set VendorImportID=1
where cast(Notes as varchar(max))='Imported by Kareo May 10, 2010'

alter table dbo.zz_import_20100507_insurance add insuranceCompanyPlan int



update z
set insuranceCompanyPlan=ip.InsuranceCompanyPlanID
from zz_import_20100507_insurance z
	inner join insuranceCompanyPlan ip
		on isnull(z.Addr1, '') = ip.AddressLine1
		and isnull(z.Add2, '') = ip.AddressLine2
		and isnull(z.City, '') = ip.City
		and isnull(z.State, '')= ip.State
		and isnull( cast(zip as varchar(32)),'')= ip.zipCode
		and isnull(z.Copy, 0)=ip.Copay
		and isnull(z.Deductible, 0)=ip.Deductible
		and isnull( Insurance + ' (copay ' + cast(isnull(Copy, 0) as varchar(32)) + ')' , '')=ip.PlanName
		and z.insuranceCompanyID=ip.insuranceCompanyID
where ip.vendorImportID=1




	-- delete [PatientCase] where vendorImportID=1
	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		patientID,	
		'Default Insurance Case',
		1,
		5,
		951,
		951,
		practiceID,
		VendorImportID,
		p.vendorID
	from Patient p
	where p.VendorImportID = 1
		and medicalRecordNumber in ( select uniquePatientID from dbo.zz_import_20100507_insurance where InsuranceCompanyPlan is not null)
	
	
-- delete InsurancePolicy where vendorImportID=1
insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
)
select 
	pc.PatientCaseID
	,i.InsuranceCompanyPlan
	,Precedence
	,Policy
	,[Group]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,i.rowID as VendorID
	,1 as VendorImportID
	,p.PracticeID
	from Patient p
		inner join dbo.zz_import_20100507_patient zp
			on zp.rowID=p.vendorID
		inner join zz_import_20100507_insurance i
			on i.uniquePatientID=zp.[Unique Patient ID]
		inner join PatientCase pc (nolock)
			on pc.patientID=p.patientID
where p.vendorImportID=1
	and InsuranceCompanyPlan is not null
order by pc.PatientCaseID, Precedence

	-- Self Pay
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorID
		,VendorImportID
		   )

	select
		patientID,	
		'DEFAULT SELF-PAY CASE',
		1,
		11,
		951,
		951,
		practiceID,
		VendorID,
		VendorImportID
	from Patient p
	where VendorImportID = 1
		and not exists(select * from patientCase pc where pc.patientID=p.patientID )




	
